nal df \n","# as.POSIXct is similar to as.Date but has time as well (need to specify format in both: \"%m/%d/%Y [%I:%M:%S %p]\")\n","# Standardise Date names to allow merging later \n","# %I is 12hr clock (1-12), %M is minutes (0-59), %S is secs (0-59), %p is AM or PM\n","# Also separate Day and Month to analyse them later \n","\n","# activity \n","c_activity <- activity %>% # using pipes to clean c_activity df\n","    rename(Date = ActivityDate) %>% #rename() part of dyplyr\n","    mutate(\n","        Date = as.Date(Date, format = '%m/%d/%Y'), # change chr to dttm type \n","        Day = weekdays(Date), # extract Day\n","        Month = months(Date)) # extract Month\n","# don't use <- within mutate(), only use assignment operator = \n","\n","# sleep \n","c_sleep <- sleep %>%\n","    rename(Date = SleepDay) %>% \n","    mutate(\n","        Date = as.POSIXct(Date, format = '%m/%d/%Y %I:%M:%S %p'), # Converts Date to a dttm type the p specifies that it's in 12 hr format \n","        Time = format(Date, format = '%H:%M:%S'), # New Time col made using format(), p removed for 24hr instead of 12hr format\n","        Day = weekdays(Date),\n","        Month = months(Date)\n","          ) \n","# format() for creating Time col only worked because Date was a dttm type\n","# everyone seems to be sleeping exactly at 12 AM. . . weird. Could be error in data collection\n","\n","\n","# weight \n","c_weight <- weight %>%\n","    mutate(\n","        Date = as.POSIXct(Date, format = '%m/%d/%Y %I:%M:%S %p'),\n","        Time = format(Date, format = '%H:%M:%S'), # Makes a 24hr Time col\n","        Day = weekdays(Date),\n","        Month = months(Date)\n","    )\n","\n","\n","# hourly_intensity\n","c_hourly_intensity <- hourly_intensity %>%\n","    mutate(\n","        Date = as.POSIXct(ActivityHour, format = '%m/%d/%Y %I:%M:%S %p'),  \n","        Time = format(Date, format = '%H:%M:%S'),\n","        Day = weekdays(Date),\n","        Month = months(Date)\n","        )\n","\n","#hourly_steps \n","c_hourly_steps <- hourly_steps %>%\n","    rename(Date = ActivityHour) %>%\n","    mutate(\n","        Date = as.POSIXct(Date, format = '%m/%d/%Y %I:%M:%S %p'),\n","        Time = format(Date, format = '%H:%M:%S'),\n","        Day = weekdays(Date),\n","        Month = months(Date)\n","        )\n"]},{"cell_type":"markdown","id":"493f3a24","metadata":{"papermill":{"duration":0.01454,"end_time":"2023-11-24T01:09:05.107162","exception":false,"start_time":"2023-11-24T01:09:05.092622","status":"completed"},"tags":[]},"source":["## Data exploration"]},{"cell_type":"code","execution_count":7,"id":"9c1042e1","metadata":{"execution":{"iopub.execute_input":"2023-11-24T01:09:05.142804Z","iopub.status.busy":"2023-11-24T01:09:05.14094Z","iopub.status.idle":"2023-11-24T01:09:05.200735Z","shell.execute_reply":"2023-11-24T01:09:05.198702Z"},"papermill":{"duration":0.082236,"end_time":"2023-11-24T01:09:05.203981","exception":false,"start_time":"2023-11-24T01:09:05.121745","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["33"],"text/latex":["33"],"text/markdown":["33"],"text/plain":["[1] 33"]},"metadata":{},"output_type":"display_data"},{"data":{"text/html":["33"],"text/latex":["33"],"text/markdown":["33"],"text/plain":["[1] 33"]},"metadata":{},"output_type":"display_data"},{"data":{"text/html":["33"],"text/latex":["33"],"text/markdown":["33"],"text/plain":["[1] 33"]},"metadata":{},"output_type":"display_data"},{"data":{"text/html":["24"],"text/latex":["24"],"text/markdown":["24"],"text/plain":["[1] 24"]},"metadata":{},"output_type":"display_data"},{"data":{"text/html":["8"],"text/latex":["8"],"text/markdown":["8"],"text/plain":["[1] 8"]},"metadata":{},"output_type":"display_data"}],"source":["# Was told that there'd be 30 fitbit participants, let's check\n","n_distinct(c_activity$Id)\n","n_distinct(c_hourly_intensity$Id)\n","n_distinct(c_hourly_steps$Id)\n","n_distinct(c_sleep$Id)\n","n_distinct(c_weight$Id)\n","# overall fairly low sample size to draw any d