for each level of activeness \n","# Reordering the Days so it displays nicer on x-axis\n","day_order <- c(\"Monday\", \"Tuesday\", \"Wednesday\", \"Thursday\", \"Friday\", \"Saturday\", \"Sunday\")\n","\n","grouped_day_intensity <- c_activity %>%\n","  mutate(Day = factor(weekdays(Date), levels = day_order)) %>% # Have to change Day as a factor before summarise() to avoid a million Monday rows \n","  group_by(Day) %>%\n","  summarise(mean_sedentary_mins = mean(SedentaryMinutes),\n","            mean_light_mins = mean(LightlyActiveMinutes),\n","            mean_fair_mins = mean(FairlyActiveMinutes),\n","            mean_active_mins = mean(VeryActiveMinutes),\n","            min_date = min(Date),\n","            max_date = max(Date),\n","            sample_size = n_distinct(Id)) %>%\n","  View()\n","\n","# stat='Identity' - height of bars directly proportional to y value \n","# position='Dodge' should move bars side to side instead of them stacking \n","# doesn't do this in output for some reason\n","ggplot(data = grouped_day_intensity) +\n","  geom_bar(mapping = aes(x = Day, y = mean_sedentary_mins, fill = 'Sedentary'), stat = 'identity', position = 'dodge') +\n","  geom_bar(mapping = aes(x = Day, y = mean_light_mins, fill = 'Lightly Active'), stat = 'identity', position = 'dodge') +\n","  geom_bar(mapping = aes(x = Day, y = mean_active_mins , fill = 'Very Active'), stat = 'identity', position = 'dodge') +\n","  geom_bar(mapping = aes(x = Day, y = mean_fair_mins , fill = 'Fairly Active'), stat = 'identity', position = 'dodge') +\n","  labs(title = 'Average Minutes Spent in Each Intensity Level',\n","       y = 'Minutes',\n","       subtitle = paste(\"Date Range: \", min(grouped_day_intensity$min_date), \" to \", max(grouped_day_intensity$max_date)),\n","       caption = paste('n=', grouped_day_intensity$sample_size))"]},{"cell_type":"markdown","id":"450a894f","metadata":{"papermill":{"duration":0.025135,"end_time":"2023-11-24T01:09:10.213737","exception":false,"start_time":"2023-11-24T01:09:10.188602","status":"completed"},"tags":[]},"source":["We see across all days, most time is spent sedentary. Interestingly, the least amount of light activity is done during Sunday.\n","- It's probably easier to encourage users to spend more time doing light intensity workouts rather than the fairy or very active ones.\n","\n","**Next, let's check out which days users spend the most & least time having intensity actitivites**"]},{"cell_type":"code","execution_count":13,"id":"a76cac09","metadata":{"execution":{"iopub.execute_input":"2023-11-24T01:09:10.268154Z","iopub.status.busy":"2023-11-24T01:09:10.266157Z","iopub.status.idle":"2023-11-24T01:09:10.681579Z","shell.execute_reply":"2023-11-24T01:09:10.679551Z"},"papermill":{"duration":0.445572,"end_time":"2023-11-24T01:09:10.684763","exception":false,"start_time":"2023-11-24T01:09:10.239191","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 7 × 6</caption>\n","<thead>\n","\t<tr><th scope=col>Day</th><th scope=col>mean_steps</th><th scope=col>sample_size</th><th scope=col>mean_total_int</th><th scope=col>min_date</th><th scope=col>max_date</th></tr>\n","\t<tr><th scope=col>&lt;fct&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;int&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;date&gt;</th><th scope=col>&lt;date&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>Monday   </td><td>7798.404</td><td>32</td><td>290.6928</td><td>2016-04-18</td><td>2016-05-09</td></tr>\n","\t<tr><td>Tuesday  </td><td>8233.340</td><td>33</td><td>298.6267</td><td>2016-04-12</td><td>2016-05-10</td></tr>\n","\t<tr><td>Wednesday</td><td>7633.415</td><td>33</td><td>282.2081</td><td>2016-04-13</td><td>2016-05-11</td></tr>\n","\t<tr><td>Thursday </td><td>7754.363</td><td>33</td><td>286.2455</td><td>2016-04-14</td><td>2016-05-12</td></tr>\n","\t<tr><td>Friday   </td><td>7502.356</td><td>33</td><td>290.2342</td><td>2016-04-15</td><td>2016-